import React, {useState} from 'react'
import Report from './footer/Report'
import Suggest from './footer/Suggest'

export default function Footer() {

const [reportB, setReportB] = useState(false);
const [suggestB, setSuggestB] = useState(false);


    return (
        <div>
            {!reportB && <p className="footer">
                חווה בעיה במערכת? <button className="justALinkNotButton"><span className="justALinkLink">דווח עליה כאן</span></button>
            </p>}
            {!suggestB && <p className="footer">
                חושב שאפשר לשפר משהו במערכת? <button className="justALinkNotButton"><span className="justALinkLink">הצע את השיפור כאן</span></button>
            </p>}
            {reportB && <Report />}
            {suggestB && <Suggest />}
        </div>
    )
}
